    console.log('component re-render');

    const incrementVal=useCallback(()=>{
        setNum((preVal)=>preVal+1)
    },[num])

    const decrement=()=>{
        setNum((preVal)=>preVal+1)
    }

  return (
    <div>
        <p>{num}</p>
            <button onClick={incrementVal}>click here</button>
            <button onClick={decrement}>click here</button>
        <Test1/>
    </div>
  )
}

export default Card
